insert into contracts values ('CT-2016-0134', null, '2016-09-23', '2016-09-23', null, 'CEB Distribuição S.A.', 'Contrato de Compra de Energia Regulada - CCER - entre o SENADO FEDERAL e a CEB Distribuição S/A, de energia elétrica para as unidades consumidoras de identificação nº 466.453-1; 491.042-7; 491.747-2; 491.750-2; 493.169-6; 605.120-0; 623.849-1; 675.051-6; 966.027-5 e 1.089.425-X.', 'https://www6g.senado.gov.br/transparencia/licitacoes-e-contratos/contratos/3842');
insert into contracts values ('CTA-2017-0119', null, '2017-12-29', '2017-12-29', null, 'CEB Distribuição S.A.', 'Estabelecer as principais condições da prestação e utilização do serviço público de energia elétrica entre a CEB Distribuição S.A e o SENADO FEDERAL, de acordo com as condições gerais de fornecimento de energia elétrica e demais regulamentos expedidos pela Agência Nacional de Energia Elétrica - ANEEL - no fornecimento continuado de energia elétrica para as diversas Unidades Consumidoras do Senado Federal, durante o período de 60 (sessenta) meses consecutivos.', 'https://www6g.senado.gov.br/transparencia/licitacoes-e-contratos/contratos/4306');
insert into contracts values ('TE-2017-0014', null, '2017-11-23', '2017-11-23', null, 'N/A', 'O Ministério de Estado do Planejamento, Desenvolvimento e Gestão, através da Secretaria de Patrimônio da União - MPDG/SPU - e a Presidência do SENADO FEDERAL, no uso de suas atribuições legais, resolvem celebrar a transferência ao Senado Federal, por meio de cessão de uso, do imóvel de propriedade da União situado no Setor de Clubes Esportivos Sul - SCE/SUL - Trecho 3 - Lote 07 - Brasília - Distrito Federal.', 'https://www6g.senado.gov.br/transparencia/licitacoes-e-contratos/contratos/4262');
insert into contracts values ('CT-2016-0165', null, '2016-12-19', '2016-12-19', null, 'CAESB - Companhia de Saneamento Ambiental do Distrito Federal', 'Contratação de empresa prestadora, de forma contínua, dos serviços públicos de abastecimento de água e esgotamento sanitário, a serem utilizados no Complexo Arquitetônico do SENADO FEDERAL pela Companhia de Saneamento Ambiental do Distrito Federal - CAESB - durante o período indeterminado de vigência contratual.', 'https://www6g.senado.gov.br/transparencia/licitacoes-e-contratos/contratos/3931');
insert into contracts values ('CT-2014-0088', null, '2014-12-09', '2014-12-09', '2019-12-08', 'RCS Tecnologia Ltda.', 'Contratação de empresa especializada para a prestação de serviços de manutenção no Sistema de Geração de Energia Elétrica de Emergência, do Complexo Arquitetônico do SENADO FEDERAL, composto de 05 (cinco) grupos motores-geradores, movidos à óleo diesel, durante o período de 36 (trinta e seis) meses consecutivos.', 'https://www6g.senado.gov.br/transparencia/licitacoes-e-contratos/contratos/3095');
insert into contracts values ('CT-2016-0110', null, '2016-08-25', '2016-08-25', '2021-08-24', 'RCS Tecnologia Ltda.', 'Contratação de empresa especializada para a prestação de serviços continuados e sob demanda, referentes à operação e manutenção preventiva e corretiva do Sistema Elétrico do Complexo Arquitetônico do SENADO FEDERAL, com operação de sistema informatizado de gerenciamento de manutenção e suprimento de insumos necessários à execução dos serviços, durante o período de 36 (trinta e seis) meses consecutivos.', 'https://www6g.senado.gov.br/transparencia/licitacoes-e-contratos/contratos/3769');
insert into contracts values ('CT-2017-0084', null, '2017-10-24', '2020-11-30', '2017-12-01', 'RCS Tecnologia Ltda.', 'Contratação de empresa especializada para prestação de serviços continuados e sob demanda, referentes à operação, manutenção preventiva e corretiva do Sistema Hidrossanitário em todo o Complexo Arquitetônico do SENADO FEDERAL, incluindo a operação de sistema de controle de manutenção informatizado, fornecimento de suprimentos, insumos e de mão de obra necessários à plena execução dos serviços, durante o período de 36 (trinta e seis) meses consecutivos.', 'https://www6g.senado.gov.br/transparencia/licitacoes-e-contratos/contratos/4298');
